import { Signature } from '@/models/Signature.model';
import { defineStore } from 'pinia'; 
import { ref } from 'vue';

export const useSignaturesStore = defineStore("signature-store",() => {
	const signatures = ref<Signature[]>([
		new Signature(1,`data:image/png;base64,`, "Google Logo"),
		new Signature(2,`data:image/png;base64,`,'New one'),
		new Signature(3,`data:image/png;base64,`,'youssef'),
		new Signature(4,`data:image/png;base64,`,'youssef'),
		new Signature(5,`data:image/png;base64,`,'youssef')
	]);

	signatures.value = JSON.parse(localStorage.getItem('signatures') || '[]').map((signature: any) => new Signature(signature.id, signature.signature, signature.title));


	async function addSignature(signature: string, title: string,hand_written = false) {
		signatures.value.push(new Signature(null,signature, title,hand_written));
		localStorage.setItem('signatures', JSON.stringify(signatures.value));
	}

	async function removeSignature(id: number) {
		if (!signatures.value.length) return;
		if (signatures.value.findIndex((signature) => signature.id === id) === -1) return;

		signatures.value = signatures.value.filter((signature) => signature.id !== id);
		localStorage.setItem('signatures', JSON.stringify(signatures.value));
	}

	async function clearSignatures() {
		signatures.value = [];
		localStorage.setItem('signatures', JSON.stringify([]));
	}

	async function getSignatureIdByFile(data:string) {
		const signature = signatures.value.find((signature) => signature.signature === data);
		if (signature) return signature.id;
		return null;
	}

	async function getSignatureById(id: number) {
		const signature = signatures.value.find((signature) => signature.id === id);
		if (signature) return signature;
		return null;
	}


	return {
		signatures,
		addSignature,
		removeSignature,
		clearSignatures,
		getSignatureIdByFile,
		getSignatureById
	}
});